  ProfileSkills,
  ProfileComponent,
  ProfileList,
  ProfileItem,
  SpanItem,
  SpanWeb,
  Skills,
  SkillsDesc,
  Bar,
  BarTitle,
  BarPercent,
  BarParent,
  BarDivSpan,
  PSTitle,
  PSTitleSpan
} from './style.js';

